#include <stdlib.h>
#include <stdio.h>
#include <iostream>
#include <vector>
#include <string>
#include <tuple>
#include <unordered_map>

std::string s = "";


std::string frequencySort(std::string s) {
    std::string t;
    std::unordered_map<char, uint32_t> frequencies;
    for(uint32_t i = 0; i < s.size(); i++) {
        char c = s[i];
        frequencies[c]++;
    }
    
    while(!frequencies.empty()) {
        char max_char = frequencies.begin()->first;
        int max_freq = frequencies.begin()->second;
        for(auto f: frequencies) {
            if(max_freq < f.second) {
                max_char = f.first;
                max_freq = f.second;
            }
        }
        printf("char=%c freq=%d sz=%lu\n", max_char, max_freq, frequencies.size());
        frequencies.erase(max_char);
        for(int i = 0; i < max_freq; i++) {
            t += max_char;
        }
    }        
    return(t);    
}

int main(int argc, char **argv){
    //std::string s = "Abbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbaaaaaaaaaaaaaaaaaaaaaaaabab";
    std::string t = frequencySort(s);
    printf("%s --> %s\n", s.c_str(), t.c_str());
    return(0);
}






